# método para crear el dataset que será mostrado en la gráfica
def make_dataset(Ro=Ro_default,
                 Time_to_death=Time_to_death_default,
                 D_recovery_mild=D_recovery_mild_default,
                 D_recovery_severe=D_recovery_severe_default,
                 D_hospital_lag=D_hospital_lag_default,
                 D_incbation=D_incbation_default,
                 D_infectious=D_infectious_default,
                 CFR_array=CFR_array_default,
                 P_SEVERE_array=P_SEVERE_array_default,
                 N_array=N_array_default,
                 InterventionStartingTime=InterventionStartingTime_default,
                 InterventionFullTime=InterventionFullTime_default,
                 InterventionR=InterventionR_default,
                 SecondInterventionR=SecondInterventionR_default,
                 SecondInterventionTime=SecondInterventionTime_default,
                 Time=Time_default,
                 P_UCI=P_UCI_default,
                 P_dead_saturacion_UCI_max=P_dead_saturacion_UCI_max_default,
                 P_dead_saturacion_UCI_min=P_dead_saturacion_UCI_min_default,
                 N_saturacion_UCI_time=N_saturacion_UCI_time_default,
                 N_saturacion_UCI=N_saturacion_UCI_default,
                 delta_UCI=delta_UCI_default,
                 edades_seleccionadas=[0, 1, 2]):
    # función que computa un step del vector de estados
    def f(stepFloat, v, Rvector, dt2, idx):
        # obtenemos los parametros del vector de inicio
        S = v[0]  # Susectable
        E = v[1]  # Exposed
        I = v[2]  # Infectious
        Mild = v[3]  # Recovering (Mild)
        Severe = v[4]  # Recovering (Severe at home)
        Severe_H = v[5]  # Recovering (Severe in hospital)
        Fatal = v[6]  # Recovering (Fatal)
        R_Mild = v[7]  # Recovered
        R_Severe = v[8]  # Recovered
        R_Fatal = v[9]  # Dead

        beta2 = Rvector[int(stepFloat)] / (D_infectious)
        p_severe = P_SEVERE_array[idx]
        p_fatal = CFR_array[idx]
        p_mild = 1 - P_SEVERE_array[idx] - CFR_array[idx]
        dS = -beta2 * I * S
        dE = beta2 * I * S - a * E
        dI = a * E - gamma * I
        dMild = p_mild * gamma * I - (1 / D_recovery_mild_array[idx]) * Mild
        dSevere = p_severe * gamma * I - (1 / D_hospital_lag_array[idx]) * Severe
        dSevere_H = (1 / D_hospital_lag_array[idx]) * Severe - (1 / D_recovery_severe_array[idx]) * Severe_H
        dFatal = p_fatal * gamma * I - (1 / D_death_array[idx]) * Fatal
        dR_Mild = (1 / D_recovery_mild_array[idx]) * Mild
        dR_Severe = (1 / D_recovery_severe_array[idx]) * Severe_H
        dR_Fatal = (1 / D_death_array[idx]) * Fatal

        return np.array([dS, dE, dI, dMild, dSevere, dSevere_H, dFatal, dR_Mild, dR_Severe, dR_Fatal])

    def integrate(m, f, y, t, h, Rvector, idx):
        k = np.empty((len(m), len(y)))
        for ki in range(0, len(m)):
            _y = np.array(y.copy())
            dt = ((m[ki - 1][0]) * h)
            for l in range(0, len(_y)):
                for j in range(1, ki):
                    _y[l] = _y[l] + h * (m[ki - 1][j]) * (k[ki - 1][l])
            k[ki] = f(t, _y, Rvector, dt, idx);
        r = y.copy()
        for l in range(0, len(_y)):
            for j in range(0, len(k)):
                r[l] = r[l] + h * (k[j][l]) * (m[ki - 1][j]);
        return r;

    N = np.sum(N_array)

    D_death = Time_to_death  # días desde que acaba el periodo de infección hasta la muerte

    df_consolidated = np.full(n_groups, Time_to_death)
    D_recovery_mild_array = np.full(n_groups, D_recovery_mild)
    D_recovery_severe_array = np.full(n_groups, D_recovery_severe)
    D_hospital_lag_array = np.full(n_groups, D_hospital_lag)
    D_death_array = np.full(n_groups, D_death)

    Ro_array = np.full(n_groups, Ro)  # tasa inicial de infección del virus

    a = 1 / D_incbation
    gamma = 1 / D_infectious

    df_state_list = []
    df_consolidated_list = []

    for idx in edades_seleccionadas:
        # print("Generating data for group", idx)
        steps = int(Time / dt)
        sample_step = 1

        ##
        steps = int(Time / dt)
        sample_step = 1
        rvector = np.full((steps), Ro)
        # creo el vector de R, con la intervención incluida
        y_init = Ro
        y_end = InterventionR
        y_delta = (y_init - y_end) / (InterventionFullTime)
        value = y_init
        for i in range(InterventionStartingTime, InterventionFullTime + InterventionStartingTime):
            rvector[i] = value
            value = value - y_delta
        for i in range(InterventionFullTime + InterventionStartingTime, steps):
            rvector[i] = InterventionR
        for i in range(SecondInterventionTime, steps):
            rvector[i] = SecondInterventionR
        ##

        # creamos el vector de estado de inicio v (V0)
        # 'susceptible','expuesto','infectado','recuperado leve','recuperando severo encasa','recuperando severo hosp',
        # 'recuperando y morirá','recuperado estado normal','recuperado severo','muertos'
        v = np.array([(1 - I0 / N), 0, I0 / N, 0, 0, 0, 0, 0, 0, 0])
        t = 0

        # inicio vacíos los DataFrame que utilizaremos
        df_state = pd.DataFrame()
        dfConsolidated = pd.DataFrame()

        init_steps = steps
        step = 0
        while (steps):
            steps = steps - 1

            # pondero los valores por la probabilidad del grupo de edad
            dfConsolidated_data = np.array(
                [np.round(np.array([N * p_groups[idx] * v[9], N * p_groups[idx] * (v[5] + v[6]),
                                    N * p_groups[idx] * (v[7] + v[8]), N * p_groups[idx] * v[2],
                                    N * p_groups[idx] * v[1], int(step * dt)]))])
            # redondeo al intero mas cerca
            dfConsolidated_data = np.rint(dfConsolidated_data)
            dfConsolidatedDelta = pd.DataFrame(dfConsolidated_data)
            dfConsolidatedDelta.columns = ['DEAD', 'HOSPITAL', 'RECOVERED', 'INFECTED', 'EXPOSED', 'TIMESTEP']
            dfConsolidated = dfConsolidated.append(dfConsolidatedDelta)
            vDF = pd.DataFrame([np.round(np.array(v) * N_array[idx])])
            vDF.columns = ['SUSCEPTIBLES', 'EXPUESTOS', 'INFECTADOS', 'RINGM', 'RINGS', 'RINGSH', 'RM', 'RS', 'RSH',
                           'MUERTOS']
            df_state = df_state.append(vDF)

            v = integrate(RK4, f, v, step, dt, rvector, idx)
            t = t + dt

            step = step + 1

        df_state_list.append(df_state)
        df_consolidated_list.append(dfConsolidated)

    # cambio Miquel - sumar los grupos activos:
    suma = pd.DataFrame()

    suma = reduce(lambda x, y: x.add(y, fill_value=0), df_consolidated_list)
    suma['TIMESTEP'] /= len(df_consolidated_list)

    # creamos el vector de saturación
    steps = int(Time / dt)
    Nsaturation = np.full((steps), N_saturacion_UCI)
    value = 0
    for i in range(N_saturacion_UCI_time, steps):
        Nsaturation[i] = N_saturacion_UCI + value
        value = value + delta_UCI
    suma['UCI'] = suma['HOSPITAL'] * P_UCI
    suma['N_saturacion_UCI'] = Nsaturation
    suma['percent_saturacion'] = suma['UCI'] / suma['N_saturacion_UCI']
    suma.loc[suma[
                 'percent_saturacion'] > P_dead_saturacion_UCI_max, 'percent_saturacion'] = P_dead_saturacion_UCI_max
    suma.loc[suma[
                 'percent_saturacion'] < P_dead_saturacion_UCI_min, 'percent_saturacion'] = P_dead_saturacion_UCI_min
    suma['DEAD_SAT_UCI'] = suma['DEAD'] * suma['percent_saturacion']

    # corrijo el acumulado
    steps = int(Time / dt)
    for i in range(1, steps):
        if (suma.iloc[i]['DEAD_SAT_UCI'] < suma.iloc[i - 1]['DEAD_SAT_UCI']):
            # crecimiento normal de muertos
            deltaDead = suma.iloc[i]['DEAD'] - suma.iloc[i - 1]['DEAD']
            deltaDeadNoSat = deltaDead * P_dead_saturacion_UCI_min
            if (deltaDeadNoSat < 0):
                deltaDeadNoSat = 0
            suma.iloc[i, suma.columns.get_loc('DEAD_SAT_UCI')] = suma.iloc[i - 1][
                                                                     'DEAD_SAT_UCI'] + deltaDeadNoSat
    suma = np.rint(suma)

    suma

    return ColumnDataSource(suma)


# método para crear la gráfica
def make_plot(source2):
    tooltips = [
        ("Tiempo", "@TIMESTEP"),
        ("Infectados", "@INFECTED"),
        ("Hospitalizados", "@HOSPITAL"),
        ("UCI", "@UCI"),
        ("Muertos", "@DEAD_SAT_UCI"),

    ]

    p2 = figure()
    p2.vbar_stack(stackers=['DEAD_SAT_UCI', 'UCI', 'HOSPITAL', 'INFECTED'], x='TIMESTEP',
                  source=source2, width=0.5, color=[Spectral4[3], Spectral4[2], Spectral4[0], Spectral4[1]],
                  legend_label=['Muertos', 'UCI', 'Hospitalizados', 'Infectados'])
    p2.plot_height = 400
    p2.plot_width = 1000
    # p2.y_range=Range1d(0,3e7)

    # invertir leyenda
    p2.legend[0].items.reverse()
    p2.left[0].formatter.use_scientific = False

    hover = HoverTool()
    hover.tooltips = tooltips

    p2.add_tools(hover)

    return p2


